function switchMusic() {
  if (switchBtn == false) {
    TweenMax.to(maskMusicBtn, {
      duration: .35,
      clipPath: "inset(100% 0% 0% 0%)",
      ease: "power3.easeOut"
    });
    TweenMax.to(maskMusicBtn, {
      duration: .25,
      clipPath: "inset(0% 0% 0% 0%)",
      ease: "power3.easeOut",
      delay: .15
    });
    TweenMax.to(maskMusicBtn, {
      duration: .25,
      clipPath: "inset(0% 0% 100% 0%)",
      ease: "power3.easeOut",
      delay: .5
    });

    if (window.matchMedia("(max-width: 1024px)").matches) {
      soundHover.play();
    }

    if (fisrtStart) {
      bgMusic.play();
      var fadeAudio = setInterval(function () {
        if (bgMusic.volume >= volume) {
          clearInterval(fadeAudio);
        } else if (bgMusic.volume < volume) {
          bgMusic.volume += 0.1;
        }
      }, 500);
    } else {
      fadeInAudio(bgLoopMusic);
    }

    switchBtn = true;
    rpzMusic.volume = volume;
    soundHover.volume = volumeBtn;
    soundHoverPlane.volume = volumePlane;
    soundOutPlane.volume = volumePlane;
  } else {
    TweenMax.to(maskMusicBtn, {
      duration: .35,
      clipPath: "inset(0% 0% 100% 0%)",
      ease: "power3.easeOut"
    });
    TweenMax.to(maskMusicBtn, {
      duration: .25,
      clipPath: "inset(0% 0% 0% 0%)",
      ease: "power3.easeOut",
      delay: .15
    });
    TweenMax.to(maskMusicBtn, {
      duration: .25,
      clipPath: "inset(100% 0% 0% 0%)",
      ease: "power3.easeOut",
      delay: .5
    });

    if (fisrtStart) {
      var fadeAudio = setInterval(function () {
        if (bgMusic.volume < 0.1) {
          clearInterval(fadeAudio);
          bgMusic.pause();
        } else if (bgMusic.volume >= .1) {
          bgMusic.volume -= .1;
        }
      }, 300);
    } else {
      fadeOutAudio(bgLoopMusic);
    }

    switchBtn = false;
    rpzMusic.volume = 0;
    soundHover.volume = 0;
    soundHoverPlane.volume = 0;
    soundOutPlane.volume = 0;
  }

  onMusic.classList.toggle('switch');
  offMusic.classList.toggle('switch');
  setTimeout(function () {
    lineMusicBtn.forEach(function (line) {
      line.classList.toggle('switch');
    });
  }, 350);
}

musicBtn.addEventListener('click', function () {
  switchMusic();

  if (!stopMusic) {
    stopMusic = true;
  } else {
    stopMusic = false;
  }
});
musicBtn.addEventListener('mouseenter', function () {
  if (!window.matchMedia("(max-width: 1024px)").matches) {
    soundHover.play();
  }
});

function cursorHoverIn() {
  if (!window.matchMedia("(max-width: 1024px)").matches) {
    gsap.to(cursorShapeOut, 0.50, {
      opacity: 0,
      ease: "Power3.easeOut"
    });

    if (indicHover == "plane") {
      soundHoverPlane.play();
    }

    if (indicHover == "plane" || indicHover == "content") {
      indicClickOnPlane.classList.add("planeHover");
      gsap.to(cursorShapeIn, 0.75, {
        background: colorCursorHover,
        padding: 50,
        ease: "Power3.easeOut"
      });
      gsap.to(cursorSize, 0.75, {
        padding: 50,
        ease: "Power3.easeOut"
      });
      gsap.to(indicClickOnPlane, .75, {
        scale: 1,
        ease: "Power3.easeOut",
        delay: .05
      });
    } else if (indicHover == "ID") {
      gsap.to(cursorShapeIn, 0.75, {
        background: colorCursorDefault,
        padding: 25,
        ease: "Power3.easeOut"
      });
      gsap.to(cursorSize, 0.75, {
        padding: 25,
        ease: "Power3.easeOut"
      });
    }
  }
}

function cursorHoverOut() {
  if (!window.matchMedia("(max-width: 1024px)").matches) {
    gsap.to(cursorSize, 0.75, {
      padding: 0,
      ease: "Power3.easeOut"
    });
    gsap.to(cursorShapeIn, 0.75, {
      background: colorCursorDefault,
      padding: 0,
      ease: "Power3.easeOut"
    });
    gsap.to(cursorShapeOut, 0.25, {
      opacity: 1,
      delay: 0.25,
      ease: "Power3.easeOut"
    });
    gsap.to(indicClickOnPlane, 0.75, {
      scale: 0,
      ease: "Power3.easeOut"
    });
    indicClickOnPlane.classList.remove("planeHover");

    if (indicHover == "plane") {
      soundOutPlane.play();
    } // indicClickOnID.classList.remove("planeHover")


    indicHover = "";
  }
} /////// PLANE HOVER SHADERS EFFECT ///////


